import React from 'react';
import styled from 'styled-components'

const HeaderContainer = styled.div`
    position: fixed;
    height: 2rem;

    margin-bottom: 10rem;

`

const ImageContainer = styled.div`
    height: 100%;
    img {
        cursor: pointer
        height: 2.5rem;
    }
`

// import IconChart from '../../chartComponents/IconChart/IconChart';

const Header = () => {

    return ( 
        <HeaderContainer>
            <ImageContainer >
                <img src='/static/icons/github.svg' alt='my image' />
            </ImageContainer>
        </HeaderContainer>
     );
}

export default Header;
